begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(64263476802404946617)
,p_plugin_type=>'REGION TYPE'
,p_name=>'APEX.ADVENT.CALENDAR'
,p_display_name=>'APEX Advent Calendar'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_RENDER (',
'    P_REGION                IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN                IN APEX_PLUGIN.T_PLUGIN,',
'    P_IS_PRINTER_FRIENDLY   IN BOOLEAN',
') RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'',
'    V_REGION_ID    VARCHAR2( 200 ) := ''acal-''',
'    || P_REGION.STATIC_ID;',
'    V_SHOW_ALL     VARCHAR2( 200 ) := P_REGION.ATTRIBUTE_01;',
'    V_MONTH        NUMBER  := P_REGION.ATTRIBUTE_02;',
'    V_SHOW_ALL_B   BOOLEAN := FALSE;',
'    V_IMG_URI      VARCHAR2( 4000 CHAR ) := P_REGION.ATTRIBUTE_03;',
'BEGIN',
'    APEX_CSS.ADD_FILE( P_NAME => ''css/style.min'', P_DIRECTORY => P_PLUGIN.FILE_PREFIX, P_VERSION => NULL, P_KEY => ''acal-style'' );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY( P_NAME => ''js/script.min'', P_DIRECTORY => P_PLUGIN.FILE_PREFIX, P_VERSION => NULL, P_KEY => ''acal-script'' );',
'',
'    SYS.HTP.P( ''<div id="''',
'    || V_REGION_ID',
'    || ''" class="acal-body">',
'    <div class="snow"> </div>',
'    <h1 class="acal-h1">Merry Christmas</h1>',
'    <ul class="acal-ul">',
'        <li class="acal-li">',
'            <div class="door">1</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">2</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">3</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">4</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">5</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">6</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">7</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">8</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">9</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">10</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">11</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">12</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">13</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">14</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">15</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">16</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">17</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">18</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">19</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">20</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">21</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">22</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">23</div>',
'        </li>',
'        <li class="acal-li">',
'            <div class="door">24</div>',
'        </li>',
'    </ul>',
'</div>''',
');',
'    IF',
'        V_SHOW_ALL = ''Y''',
'    THEN',
'        V_SHOW_ALL_B   := TRUE;',
'    END IF;',
'    APEX_JAVASCRIPT.ADD_ONLOAD_CODE( ''acalInit(''',
'    || APEX_JAVASCRIPT.ADD_VALUE( P_PLUGIN.FILE_PREFIX, TRUE )',
'    || APEX_JAVASCRIPT.ADD_VALUE( V_IMG_URI, TRUE )',
'    || APEX_JAVASCRIPT.ADD_VALUE( V_SHOW_ALL_B, TRUE )',
'    || APEX_JAVASCRIPT.ADD_VALUE( V_MONTH, FALSE )',
'    || '');'' );',
'',
'    RETURN NULL;',
'END;'))
